import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import Post from "@/components/Post"

import { waynedahlberg } from "@/authors";
import image1 from "./IMG_0481.jpg";
import image2 from "./IMG_0924.jpg";
import image3 from "./IMG_0950.jpg";
import image4 from "./IMG_1125.jpg";
import image5 from "./R2D2-July1-8306.jpg";
export { getStaticProps } from "@/getStaticProps";
export const meta = {
  title: `End of year Update`,
  description: `A lot has happened`,
  date: "2016-12-27T14:24:00.000Z",
  authors: [waynedahlberg],
  discussion: "https://github.com/tailwindlabs/tailwindcss/discussions/2511"
};
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  meta
};
const MDXLayout = (props) => <Post meta={meta} {...props} />
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">




    <p>{`Most updates for this project are happening on Instagram. It’s easy for me snap a few pics and post there, and at the same time, each post will be printed in my R2D2 `}<a parentName="p" {...{
        "href": "http://www.chatbooks.com/"
      }}>{`Chatbook`}</a>{`.`}</p>
    <p>{`In summary, the dome is coming along. I have all the greeblies for inside except for the hinges and the magic panel. RLD and FLD’s are working, PSI housings are complete, need to finish building the LED boards for those. I’ve soldered up the boards for the HP’s, and 3D printed some base brackets that stand-off and mount the servos. Need to buy servos, oh and all the dome hinges.`}</p>
    <p>{`Major breakthrough, after being on the waiting/standby list for Commando-8’s CS:R aluminum frame, the time has finally come. Out of the 3 batches of frames James is doing this year, enough people on the interest list backed out that it reached my spot #37 on the standby list. Frame is ordered and on the way. I opted for all the trinkets that go with it. Very excited to put this together.`}</p>
    <p>{`I have the WORRParts all aluminum legs with cast booster covers and billet aluminum shoulders and spacers. Still need the greeblies that attach to the booster covers, booster covers to complete the legs.`}</p>
    <p>{`I figure once the frame is assembled, attached to the dome, and the dome drive connected and spinning, it will be a whole new ballgame. Tired of just staring at the dome.`}</p>
    <p>{`Next steps are to get the skins and mount them to the frame. Order the Octagon Ports, coin returns, coin slots, and side vents. Then on to order the hinges and assemble all the panels, servos, actuators, HP’s, PSI’s, and whatnot for the dome. It’s like a never ending list.`}</p>
    <p>{`Then I’ll take a breath before diving into ankles, feet and drive motors. Still hoping for a finish date a little less that a year away. Gotta keep cranking.`}</p>
    <p>{`Also, R.I.P. Carrie Fisher. She passed away today, and is surely missed by everyone.`}</p>

    </MDXLayout>;
}

;
